import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";

export default function Login(props){
    return(
      <div>
        <Navbar/>
    <button 
      className="rounded-full h-80 w-80 mt-10 flex items-center justify-center bg-gray-400 text-white focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500"
      onClick={props.onClick}>
      <img 
        className="rounded-full h-80 w-80 object-cover"
        src={props.imageSrc} 
        alt={props.altText} />
    </button>


      <Footer/>
      </div> 
    );
}
